import React from 'react';

const CardProject = ({cardProjectClassName, image, title, location, imgClassName, bodyClassName}) => {
    return(
        <div className="card-project">
            <div className={cardProjectClassName}>
        <img src={image} className={imgClassName} alt="Project_Photo" />
        <div className={bodyClassName}>
            <div className="card-project-title">{title}</div>
            <div className="card-project-location">{location}</div>
        </div>
        </div>
        </div>
    );


};

export default CardProject;
